import React, { useState } from 'react';
import { useDispatch } from 'react-redux';
import { useNavigate, Link } from 'react-router-dom';
import { signupUser } from '../components/redux/features/AuthSlice';
import './signup.css';
import CustomBackDrop from '../components/UI/CustomBackDrop';
import CustomSnackBar from '../components/UI/CustomSnackBar';

function SignUp() {
  const [email, setEmail] = useState('');
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [snackbarOpen, setSnackbarOpen] = useState(false);
  const [snackbarMessage, setSnackbarMessage] = useState('');
  const [snackbarSeverity, setSnackbarSeverity] = useState('success');
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const handleSnackbarClose = (event, reason) => {
    if (reason === 'clickaway') {
      return;
    }
    setSnackbarOpen(false);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!email || !password || !confirmPassword || !firstName || !lastName) {
      setSnackbarMessage('Please fill in all fields.');
      setSnackbarSeverity('error');
      setSnackbarOpen(true);
      return;
    }
    if (password !== confirmPassword) {
      setSnackbarMessage('Passwords do not match.');
      setSnackbarSeverity('error');
      setSnackbarOpen(true);
      return;
    }
    setLoading(true);
    try {
      await dispatch(signupUser({ email, password, firstName, lastName })).unwrap();
      setSnackbarMessage('Signup successful!');
      setSnackbarSeverity('success');
      setSnackbarOpen(true);
      setLoading(false);
      navigate('/login');
    } catch (err) {
      setSnackbarMessage('Signup failed. Please try again.');
      setSnackbarSeverity('error');
      setSnackbarOpen(true);
      setLoading(false);
    }
  };

  return (
    <div className="auth-form-container">
      <h2 className="auth-form-title">SIGN UP</h2>
      <p className="auth-form-subtitle">Please Enter your Email, Password, and Confirm Password!</p>

      <form onSubmit={handleSubmit} className="auth-form">
        <div className="input-group">
          <input
            type="text"
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
            required
            className="auth-input"
          />
          <label className="auth-label">FirstName</label>
        </div>
        <div className="input-group">
          <input
            type="text"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
            required
            className="auth-input"
          />
          <label className="auth-label">LastName</label>
        </div>
        <div className="input-group">
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            className="auth-input"
          />
          <label className="auth-label">Email</label>
        </div>

        <div className="input-group">
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
            className="auth-input"
          />
          <label className="auth-label">Password</label>
        </div>

        <div className="input-group">
          <input
            type="password"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
            className="auth-input"
          />
          <label className="auth-label">Confirm Password</label>
        </div>

        <div className="auth-button-container">
          <button type="submit" className="auth-button">Sign Up</button>
        </div>

        <div className="form-links">
          <p>Already have an account? <Link to="/login" className="auth-link">Login</Link></p>
        </div>
      </form>

      <CustomBackDrop loading={loading} />
      <CustomSnackBar 
        snackbarOpen={snackbarOpen} 
        handleSnackbarClose={handleSnackbarClose} 
        snackbarSeverity={snackbarSeverity} 
        snackbarMessage={snackbarMessage} 
      />
    </div>
  );
}

export default SignUp;
